import { useNavigate } from 'react-router-dom'

const Home = () => {
    function push(){
        let navigate = useNavigate();
        navigate("/productcategories");
    }
    return (
        <>
        <h1>Home Page</h1>
        <button onClick={push}>Push</button>
        </>
    )
}

export default Home
